# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - flask.Blueprint~Subclass
    - flask_debugtoolbar
    - Member[Blueprint]
  - - flask.Response~Subclass
    - flask_debugtoolbar
    - Member[panels].Member[template].Member[Response]
  - - markupsafe.Markup~Subclass
    - flask_debugtoolbar
    - Member[utils].Member[Markup]
